import React from 'react';
import { isEqual } from 'lodash';

const weatherList = [
  { name: '晴', pic: 'data:image/svg+xml;base64,' },
  { name: '多云', pic: 'data:image/svg+xml;base64,' },
  { name: '阴', pic: 'data:image/svg+xml;base64,' },
  { name: '小雨', pic: 'data:image/svg+xml;base64,' },
  { name: '中雨', pic: 'data:image/svg+xml;base64,' },
  { name: '大雨', pic: 'data:image/svg+xml;base64,' },
  { name: '阵雨', pic: 'data:image/svg+xml;base64,' },
  { name: '暴雨', pic: 'data:image/svg+xml;base64,' },
  { name: '雷阵雨', pic: 'data:image/svg+xml;base64,' },
  { name: '雷暴雨', pic: 'data:image/svg+xml;base64,' },
  { name: '小雪', pic: 'data:image/svg+xml;base64,' },
  { name: '中雪', pic: 'data:image/svg+xml;base64,' },
  { name: '大雪', pic: 'data:image/svg+xml;base64,' },
  { name: '雾天', pic: 'data:image/svg+xml;base64,' },
  { name: '霜冻', pic: 'data:image/svg+xml;base64,' }
]

/**
 * 天气 返回dataProvider = "大雨"
 *
 * @class Weather
 * @extends {React.Component}
 */
class Weather extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      // 天气名称
      name: '',
      pic: ''
    }
  }

  initialState = data => {
    const name = data || '晴';
    const pic = this.getWeather(name);
    this.setState({
      name: name,
      pic
    });
  }

  componentDidMount() {
    const { dataProvider } = this.props;
    const name = (Array.isArray(dataProvider) && dataProvider.length && dataProvider[0]) || '晴';
    this.initialState(name);
  }

  componentWillReceiveProps(nextProps) {
    if (!isEqual(this.props, nextProps)) {
      const { dataProvider = [] } = nextProps;
      const prePropsData = this.props.dataProvider[0] || {};
      const nextPropsData = dataProvider[0] || {};
      const newStateData = Object.assign({}, prePropsData, nextPropsData);
      this.initialState(newStateData);
    }
  }

  // 根据名称获取图标
  getWeather = name => {
    const obj = weatherList.find(item => item.name === name) || {};
    return obj.pic;
  }

  render(){
    const { pic } = this.state;
    return <div style={{ width: '100%', height: '100%' }}>
      <img src={pic} style={{ width: '100%', height: '100%' }}/>
    </div>
  }
}

export default Weather;
